}

.o-nav-v li {
  font-weight: bolder;
  margin-bottom: 1px;
}

.o-nav-v li ul {
  margin: 0.5rem 0.5rem 1rem;
}

.o-nav-v li li {
  font-weight: lighter;
}

.o-nav-v li li ul {
