}

.o-search__bar input {
  height: 100%;
  border: none;
  width: 100%;
  text-transform: uppercase;
}

@media only screen and (min-width: 575px) {
  .o-search__bar input {
    padding: 1.2rem;
  }
}

@media only screen and (max-width: 575px) {
  .o-search__bar input {
    line-height: 1;
    padding: 0.6rem;
  }
}

.o-search__status,
.o-search__reset {
  position: absolute;
  left: -2em;
  font-size: 0.5rem;
  top: 0;
}

.o-search__reset {
  display: inline-block;
  font: normal normal normal 14px/1 FontAwesome;
  font-size: inherit;
  text-rendering: auto;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

.o-search__reset::before {
