}

.o-search__toggle i::before {
  content: "\F002";
}

.has-search-open .o-search__toggle i::before {
  content: "\F00D";
}

.c-card {
  position: relative;
  max-width: 100%;
  border-radius: 2px;
}

@media only screen and (max-width: 991px) {
  .c-card + .c-card {
    margin-top: 2rem;
  }
}

.c-card__wrap {
