          box-shadow: 8px 8px 0 0 #333;
}

.c-card__wrap > * + * {
  border-top: 1px solid #333;
}

.c-card img {
  max-width: 100%;
}

.c-card section {
  padding: 1rem;
  -webkit-box-flex: 1;
      -ms-flex-positive: 1;
          flex-grow: 1;
}

.c-card section > *:last-child {
  margin-bottom: 0;
  padding-bottom: 0;
}

.c-card footer {
  padding: 1rem;
  text-transform: uppercase;
  font-size: 0.8rem;
}

.c-card footer > *:last-child {
  margin-bottom: 0;
}

article img {
  max-width: 100%;
  width: auto;
  height: auto;
}

article section a,
article footer a {
  background-color: #dadada;
  margin: -0.1em;
  padding: 0.1em;
  border: 0.1em solid transparent;
  background-clip: padding-box;
  -webkit-transition: background-color 0.2s;
  -o-transition: background-color 0.2s;
  transition: background-color 0.2s;
}

article section a:hover,
article section a:focus,
article footer a:hover,
article footer a:focus {
  text-decoration: none;
  background-color: #fff;
}

